const operation = $input.item.json.params?.operation || 'execute';
const body = $input.item.json.body || {};
const trace_id = `CONN-${Date.now()}-${Math.random().toString(36).substr(2, 6)}`;

return {
  operation: operation,
  body: body,
  trace_id: trace_id,
  timestamp: new Date().toISOString(),
  start_time: Date.now()
};

const fs = require('fs');
const path = process.env.CONNECTOR_REGISTRY_PATH || '/data/Aigent_Modules_Core/connectors_registry.json';

try {
  const registryData = fs.readFileSync(path, 'utf8');
  const connectors = JSON.parse(registryData);
  globalThis.aigent_registry = connectors;

  return {
    success: true,
    connectors: connectors,
    registry_path: path,
    connector_count: connectors.length,
    trace_id: $input.item.json.trace_id
  };
} catch (error) {
  return {
    success: false,
    error: 'registry_load_failed',
    error_message: error.message,
    registry_path: path,
    trace_id: $input.item.json.trace_id
  };
}

const connectors = globalThis.aigent_registry || [];
const requestedId = $('Add Metadata').first().json.body.connector_id;

const connector = connectors.find(c => c.id === requestedId);

if (!connector) {
  return {
    success: false,
    error: 'Connector not found',
    connector_id: requestedId,
    available_connectors: connectors.map(c => c.id)
  };
}

return {
  success: true,
  connector: connector,
  trace_id: $('Add Metadata').first().json.trace_id
};

const connectors = globalThis.aigent_registry || [];
const connectorId = $('Add Metadata').first().json.body.connector_id;
const payload = $('Add Metadata').first().json.body.payload;
const direction = $('Add Metadata').first().json.body.direction || 'request';

const connector = connectors.find(c => c.id === connectorId);
if (!connector) {
  return { success: false, error: 'Connector not found' };
}

const adapters = {
  calendar: {
    normalizeRequest: (req) => ({
      date: req.date || req.preferred_date || new Date().toISOString().split('T')[0],
      duration: req.duration || 30,
      timezone: req.timezone || 'America/New_York'
    }),
    normalizeResponse: (res) => ({
      slots: res.slots || res.data?.slots || res.available_times || [],
      next_available: res.next_available || (res.slots && res.slots[0]) || null
    })
  },
  messaging: {
    normalizeRequest: (req) => ({
      recipient: req.recipient || req.to || req.email,
      message: req.message || req.body || req.text,
      channel: req.channel || 'email'
    }),
    normalizeResponse: (res) => ({
      message_id: res.message_id || res.id || res.sid,
      status: res.status || 'sent'
    })
  },
  video: {
    normalizeRequest: (req) => ({
      topic: req.topic || 'Video Meeting',
      start_time: req.start_time || new Date().toISOString(),
      duration: req.duration || 60
    }),
    normalizeResponse: (res) => ({
      meeting_id: res.meeting_id || res.id,
      join_url: res.join_url || res.url,
      start_url: res.start_url || res.host_url
    })
  },
  payment: {
    normalizeRequest: (req) => ({
      amount: req.amount,
      currency: req.currency || 'USD',
      customer_email: req.customer_email || req.email
    }),
    normalizeResponse: (res) => ({
      charge_id: res.charge_id || res.id,
      status: res.status,
      receipt_url: res.receipt_url
    })
  },
  storage: {
    normalizeRequest: (req) => req,
    normalizeResponse: (res) => res
  },
  crm: {
    normalizeRequest: (req) => ({
      fields: req.fields || req.data
    }),
    normalizeResponse: (res) => ({
      record_id: res.record_id || res.id
    })
  }
};

const adapter = adapters[connector.type] || { normalizeRequest: (r) => r, normalizeResponse: (r) => r };
const normalized = direction === 'request' 
  ? adapter.normalizeRequest(payload)
  : adapter.normalizeResponse(payload);

return {
  success: true,
  connector_id: connectorId,
  connector_type: connector.type,
  direction: direction,
  original_payload: payload,
  normalized_payload: normalized,
  trace_id: $('Add Metadata').first().json.trace_id
};

const mockModeGlobal = (process.env.MOCK_MODE_GLOBAL || 'false').toLowerCase() === 'true';
const connectors = globalThis.aigent_registry || [];
const connectorId = $('Add Metadata').first().json.body.connector_id;
const endpoint = $('Add Metadata').first().json.body.endpoint;
const payload = $('Add Metadata').first().json.body.payload;

const connector = connectors.find(c => c.id === connectorId);
if (!connector) {
  return { success: false, error: 'Connector not found', connector_id: connectorId };
}

if (!connector.endpoints[endpoint]) {
  return { success: false, error: 'Endpoint not found', endpoint: endpoint, available_endpoints: Object.keys(connector.endpoints) };
}

const endpointDef = connector.endpoints[endpoint];

const connectorType = connector.type.toUpperCase();
const typeMockEnv = `MOCK_${connectorType}`;
const connectorMockMode = process.env[typeMockEnv];

let useMock = false;
let mockReason = '';

if (mockModeGlobal) {
  useMock = true;
  mockReason = 'MOCK_MODE_GLOBAL=true';
} else if (connectorMockMode && connectorMockMode.toLowerCase() === 'true') {
  useMock = true;
  mockReason = `${typeMockEnv}=true`;
} else {
  const tokenEnv = connector.auth.token_env || connector.auth.key_env;
  const credValue = tokenEnv ? process.env[tokenEnv] : null;

  if (!credValue || credValue.trim() === '') {
    useMock = true;
    mockReason = 'credentials_missing';
  }
}

if (useMock) {
  let mockDataValue = connector.mock_data;

  return {
    success: true,
    mode: 'mock',
    connector_id: connectorId,
    endpoint: endpoint,
    mock_data: mockDataValue,
    mock_reason: mockReason,
    delegate_to: 'module_11B',
    payload: payload,
    trace_id: $('Add Metadata').first().json.trace_id
  };
}

return {
  success: true,
  mode: 'live',
  connector_id: connectorId,
  endpoint: endpoint,
  payload: payload,
  connector: connector,
  endpointDef: endpointDef,
  trace_id: $('Add Metadata').first().json.trace_id
};

const axios = require('axios');
const execData = $input.item.json;
const connector = execData.connector;
const endpointDef = execData.endpointDef;
const payload = execData.payload;

const headers = {
  'Content-Type': 'application/json',
  'User-Agent': 'Aigent-ConnectorManager/1.0'
};

if (connector.auth.mode === 'bearer') {
  const token = process.env[connector.auth.token_env];
  if (token) {
    headers['Authorization'] = `Bearer ${token}`;
  } else {
    return {
      success: false,
      error_type: 'auth_error',
      error_message: `Missing token: ${connector.auth.token_env}`,
      connector_id: execData.connector_id,
      endpoint: execData.endpoint,
      trace_id: execData.trace_id
    };
  }
} else if (connector.auth.mode === 'apiKey') {
  const key = process.env[connector.auth.key_env];
  if (key) {
    headers['Authorization'] = `Bearer ${key}`;
  } else {
    return {
      success: false,
      error_type: 'auth_error',
      error_message: `Missing API key: ${connector.auth.key_env}`,
      connector_id: execData.connector_id,
      endpoint: execData.endpoint,
      trace_id: execData.trace_id
    };
  }
}

const mappedPayload = {};
for (const [targetKey, sourceKey] of Object.entries(endpointDef.request_map || {})) {
  mappedPayload[targetKey] = payload[sourceKey] !== undefined ? payload[sourceKey] : payload[targetKey];
}

let baseUrl = connector.base_url.replace(/{{\$env\.(\w+)}}/g, (match, envVar) => {
  return process.env[envVar] || match;
});

if (!baseUrl.endsWith('/') && !endpointDef.path.startsWith('/')) {
  baseUrl += '/';
}
if (baseUrl.endsWith('/') && endpointDef.path.startsWith('/')) {
  baseUrl = baseUrl.slice(0, -1);
}

const url = baseUrl + endpointDef.path;
const method = endpointDef.method.toUpperCase();
const timeout = parseInt(process.env.DEFAULT_TIMEOUT_MS || '10000');

let requestConfig = {
  method: method,
  url: url,
  headers: headers,
  timeout: timeout
};

if (method === 'GET') {
  requestConfig.params = mappedPayload;
} else {
  requestConfig.data = mappedPayload;
}

try {
  const startTime = Date.now();
  const response = await axios(requestConfig);
  const duration = Date.now() - startTime;

  const mappedResponse = {};
  for (const [targetKey, sourcePath] of Object.entries(endpointDef.response_map || {})) {
    const keys = sourcePath.split('.');
    let val = response.data;
    for (const k of keys) {
      val = val?.[k];
    }
    mappedResponse[targetKey] = val;
  }

  return {
    success: true,
    source: 'live',
    connector_id: execData.connector_id,
    endpoint: execData.endpoint,
    data: mappedResponse,
    raw_response: response.data,
    status_code: response.status,
    duration_ms: duration,
    trace_id: execData.trace_id
  };
} catch (error) {
  let errorType = 'network_error';
  let errorMessage = error.message;
  let statusCode = null;
  let rawResponse = null;

  if (error.response) {
    statusCode = error.response.status;
    rawResponse = error.response.data;

    if (statusCode === 401 || statusCode === 403) {
      errorType = 'auth_error';
      errorMessage = `Authentication failed: ${statusCode}`;
    } else if (statusCode >= 400 && statusCode < 500) {
      errorType = 'http_error';
      errorMessage = `Client error: ${statusCode}`;
    } else if (statusCode >= 500) {
      errorType = 'http_error';
      errorMessage = `Server error: ${statusCode}`;
    }
  } else if (error.code === 'ECONNABORTED') {
    errorType = 'network_error';
    errorMessage = 'Request timeout';
  } else if (error.code === 'ENOTFOUND' || error.code === 'ECONNREFUSED') {
    errorType = 'network_error';
    errorMessage = `Network error: ${error.code}`;
  }

  return {
    success: false,
    source: 'live',
    error_type: errorType,
    error_message: errorMessage,
    status_code: statusCode,
    raw_response: rawResponse,
    connector_id: execData.connector_id,
    endpoint: execData.endpoint,
    trace_id: execData.trace_id
  };
}

const connectors = globalThis.aigent_registry || [];
const moduleId = $('Add Metadata').first().json.body.module_id;
const serviceType = $('Add Metadata').first().json.body.service_type;

const moduleConnectors = connectors.filter(c => 
  c.modules_using.includes(moduleId) ||
  (serviceType && c.type === serviceType)
);

if (moduleConnectors.length === 0) {
  return {
    success: false,
    error: 'No connectors found',
    module_id: moduleId,
    service_type: serviceType
  };
}

const primary = moduleConnectors[0];

return {
  success: true,
  module_id: moduleId,
  service_type: serviceType,
  primary_connector: {
    id: primary.id,
    name: primary.name,
    type: primary.type,
    base_url: primary.base_url,
    endpoints: Object.keys(primary.endpoints)
  },
  alternatives: moduleConnectors.slice(1).map(c => ({
    id: c.id,
    name: c.name
  })),
  trace_id: $('Add Metadata').first().json.trace_id
};
